import React from 'react'

export default class LeagueButton extends React.Component {

    handleClick(event) {
        alert('clicked');
    }

    render() {
        return(
            <div className='league-button' onClick={this.handleClick}>
                {this.props.league}
            </div>
        )
    }
}
